    s_el_d1b = output_dict['verification_results']['nen_pile_results']['sel_d1b']
    s_21b = output_dict['verification_results']['nen_pile_results']['s2_d1b']
    s_d1b = s_neg1b + s_b1b + s_el_d1b + s_21b

